O) * 7459 / 3600);\n    lams[0].push(steadyStateGrowthRate(gamma_max, const_phiRb, nu_max[i], Kd_cpc, phi_O))\n    let sc2_phiRb = (1 - phi_O) * (nu_max[i] / (nu_max[i] + gamma_max));\n    phiRbs[1].push(sc2_phiRb);\n    gammas[1].push(steadyStateGamma(gamma_max, sc2_phiRb, nu_max[i], Kd_cpc, phi_O) * 7459 / 3600);\n    lams[1].push(steadyStateGrowthRate(gamma_max, sc2_phiRb, nu_max[i], Kd_cpc, phi_O))\n    let sc3_phiRb = optimalAllocation(gamma_max, nu_max[i], Kd_cpc, phi_O);\n    phiRbs[2].push(sc3_phiRb);\n    gammas[2].push(steadyStateGamma(gamma_max, sc3_phiRb, nu_max[i], Kd_cpc, phi_O) * 7459 / 3600);\n    lams[2].push(steadyStateGrowthRate(gamma_max, sc3_phiRb, nu_max[i], Kd_cpc, phi_O))\n\n}\n\n// Update the source and emit the change\ndata['phiRb'] = phiRbs;\ndata['gamma'] = gammas;\ndata['lam'] = lams;\nsource.change.emit()\n\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING SELF-REPLICATOR MODEL\n// /////////////////////////////////////////////////////////////////////////////\n\n\nfunction selfReplicator(params,args, dt) { \n    let [M, M_Rb, M_Mb, c_pc, c_nt] = params;\n    let [gamma_max, nu_max, Y, phi_Rb, phi_O, Kd_cpc, Kd_cnt] = args;\n\n    // Compute the transalational efficiency\n    let gamma = gamma_max * (c_pc / (c_pc + Kd_cpc));\n    let nu = nu_max * (c_nt / (c_nt + Kd_cnt));\n\n    // Define the biomass dynamics\n    let dM_dt = gamma * M_Rb;\n    \n    // Define allocation dynamics\n    let dM_Rb_dt = phi_Rb * dM_dt;\n    let dM_Mb_dt = (1 - phi_Rb - phi_O) * dM_dt;\n\n    // Define precursor dynamics\n    let dcpc_dt = (nu * M_Mb - dM_dt * (1 + c_pc)) / M;\n\n    // Define nutrient dynamics\n    let dcnt_dt = -nu * M_Mb / Y;\n    return [dM_dt * dt, dM_Rb_dt * dt, dM_Mb_dt * dt, dcpc_dt * dt, dcnt_dt * dt]\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING STEADY-STATE PARAMETERS\n// /////////////////////////////////////////////////////////////////////////////\nfunction steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let growth_rate = steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O)\n    return (nu_max * (1 - phi_Rb - phi_O) / growth_rate) - 1\n}\n\nfunction steadyStateGrowthRate(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let Gamma = gamma_max * phi_Rb;\n    let Nu = nu_max * (1 - phi_Rb - phi_O);\n    let numer = Nu + Gamma - Math.sqrt(Math.pow(Nu + Gamma, 2) - 4 * (1 - Kd_cpc) * Nu * Gamma)\n    let denom = 2 * (1 - Kd_cpc);\n    return numer / denom\n}\n\nfunction steadyStateGamma(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O) {\n    let cpc = steadyStatePrecursorConc(gamma_max, phi_Rb, nu_max, Kd_cpc, phi_O);\n    return gamma_max * (cpc / (cpc + Kd_cpc));\n}\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS DEFINING ALLOCATION STRATEGIES\n// /////////////////////////////////////////////////////////////////////////////\nfunction optimalAllocation(gamma_max, nu_max, Kd_cpc, phi_O) {\n    let prefix = 1 / (4 * Kd_cpc * gamma_max * nu_max - Math.pow(nu_max + gamma_max, 2))\n    let bracket = 2 * Kd_cpc * gamma_max * nu_max - gamma_max * nu_max + Math.sqrt(Kd_cpc * gamma_max * nu_max) * (nu_max - gamma_max) - Math.pow(nu_max, 2)\n    return (1 - phi_O) * prefix * bracket\n}\n\n\n// /////////////////////////////////////////////////////////////////////////////\n// FUNCTIONS FOR NUMERICAL INTEGRATION\n// /////////////////////////////////////////////////////////////////////////////\nfunction odeintForwardEuler(fun, params, args, dt, nSteps) { \n    let out = [params]; \n    for (let i=1; i &lt; nSteps ; i++) { \n        let deriv = fun(out[i-1], args, dt)\n        for (let j=0; j &lt; deriv.length; j++) {\n            deriv[j] = out[i-1][j] + deriv[j];\n        }\n        out.push(deriv);\n    }\n    return out\n}\n\n\n// \n\n// Function for linearly spacing values. Adapted from StackOverflow user mhodges\n// https://stackoverflow.com/questions/40475155/does-javascript-have-a-method-that-returns-an-array-of-numbers-based-on-start-s\nfunction linSpace(startValue, stopValue, nSteps) {\n  let arr = [];\n  let step = (stopValue - startValue) / nSteps;\n  for (var i = 0; i &lt; nSteps; i++) {\n    arr.push(startValue + (step * i));\n  }\n  return arr;\n}\n"},"id":"9760","type":"CustomJS"},{"attributes":{"align":"left","background_fill_color":"#FFFFFF","coordinates":null,"group":null,"offset":5,"text_color":"#3c3c3c","text_font_size":"10pt","text_font_style":"normal"},"id":"9770","type":"Title"},{"attributes":{},"id":"9757","type":"Selection"},{"attributes":{"axis":{"id":"9657"},"coordinates":null,"grid_line_color":"#FFFFFF","grid_line_width":0.75,"group":null,"ticker":null},"id":"9660","type":"Grid"},{"attributes":{},"id":"9756","type":"UnionRenderers"},{"attributes":{"overlay":{"id":"9668"}},"id":"9667","type":"BoxZoomTool"},{"attributes":{},"id":"9665","type":"PanTool"},{"attributes":{"align":"left","background_fill_color":"#FFFFFF","coordinates":null,"group":null,"offset":5,"text_color":"#3c3c3c","text_font_size":"10pt","text_font_style":"normal"},"id":"9748","type":"Title"},{"attributes":{"callback":null,"names":["data"],"tooltips":[["source","@source"],["ribosomal allocation","@mass_fraction{0.2f}"],["growth rate\n[inv. hr.]","@growth_rate_hr{0.2f}"],["method","@method"]]},"id":"9646","type":"HoverTool"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"9668","type":"BoxAnnotation"},{"attributes":{},"id":"9780","type":"AllLabels"},{"attributes":{"background_fill_alpha":0.75,"background_fill_color":"#f0f3f7","border_line_color":"slategray","border_line_width":0.75,"coordinates":null,"group":null,"items":[{"id":"9759"}]},"id":
